
CREATE TABLE IF NOT EXISTS users (
    id INT PRIMARY KEY NOT NULL,
    username TEXT NOT NULL,
    password TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS xflow (
    id INT PRIMARY KEY NOT NULL,
    in_bytes INT NOT NULL,
    in_pkts INT NOT NULL,
    protocol CHAR(25) NOT NULL,
    l4_src_port INT NOT NULL,
    l4_dst_port INT NOT NULL,
    out_bytes INT NOT NULL,
    out_pkts INT NOT NULL,
    ipv6_src_addr CHAR(25) NOT NULL,
    ipv6_dst_addr CHAR(25) NOT NULL
);

